import Nav from './components/Nav'
import Home from './pages/Home'

import { BrowserRouter, Router, Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div>
        <Nav />
        <Router>
          <div>
          <Route 
            path="/"
            render={<Home/>}
          />
          </div>
        </Router>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
